import AccountSidebar from "../components/AccountSidebar";
import { useState } from "react";
import { Link, BrowserRouter, Routes, Route, useLocation, Navigate } from "react-router-dom";
import Validators from "./Validators";

export default function AccountPage() {
  return (
    <div className="container mx-auto max-w-full">
      <div className="md:flex gap-6">
        <AccountSidebar />
        <div className="card bg-white md:p-10 p-5 rounded-2xl mt-5 lg:w-3/4 w-full">
          <Routes>
            <Route exact path="/myaccount/validators" element={<Validators />} />
          </Routes>
        </div>
      </div>
    </div>
  );
}
